import React from 'react';

const ClientList = () => { 
    return( 
        <table className="table table-hover">
            <thead className='table-info'>
                <tr>
                    <th>Name</th>
                    <th>Email ID</th>
                    <th>Mobile Number</th>
                    <th>Address</th>
                    <th>Start Date</th>
                    <th>End Date</th>
                </tr>
            </thead>
        </table> 
    ); 
}

    export default ClientList;
